    "2016-07-27T22:57:46.995041",nt"name": "mcnary-camelthorn-control",nt"isopen":
    false,nt"url": null,nt"notes": "The project as described was to chemically
    control camelthorn (Alhagi maurorum) on the Fee Hunt and Peninsula Units of McNary
    Refuge.  Camelthorn is a highly aggressive, deep-rooted, rhizomatous woody shrub
    that can invade and displace intact native habitats.  It has little to no forage
    or cover value and once fully established can form near monocultures, severely degrading
    habitat values.  Camelthorn was known to infest approximately 300 acres within the
    Fee Hunt and Peninsula Units.",nt"license_title": "License Not Specified",nt"extras":
